import React from 'react';
import SongCard from './SongCard';
import { withRouter } from 'react-router-dom';
//withRouter gives the app the props
class SongList extends React.Component{
  state = {
    songs: []
  }

  componentDidMount = () => {
    const url = this.props.currentPlaylist.links.tracks.href
    Object.keys(this.props.currentPlaylist).length > 0
    ? fetch(url)
    .then(resp => resp.json())
    .then(track => {
      this.setState({
        songs: track
      })
    })
    : <h1>Didn't Work</h1>
  }

  // console.log(this.props.playlist.href + '?apikey=MTU1YjllNjUtOTIwNi00MGJlLWJlOWMtZGYxMjJhZDI0NTk5');
  render(){
    console.log("SongList", this.props);
    return(
      <div>
      <h1>Song List</h1>
      </div>
    )
  }
}

export default withRouter(SongList);
